export default () => {
  return (
    <div className="home">
      {[1, 2, 3, 4, 5].map(() => {
        return (
          <>
            <Item texto="texto" />
            {[1, 2, 3, 4, 5, 6, 7, 8, 9].map(() => {
              return (
                <CardComp
                  cardText="Descripcion"
                  cardTitle="Titulo"
                  cardSubTitle="Subtitulo"
                  cardImg="https://placedog.net/300/250"
                ></CardComp>
              );
            })}
          </>
        );
      })}
    </div>
  );
};
